import { EachPostLi } from "./styledComponent";

function EachPost(){
    return (
        <EachPostLi>
            <div>
                <FontAwesomeIcon icon={faLocationPin} />
                <PostLink>
                서강학보 시사 N 대학기자상 취재 
                </PostLink>
            </div>
        <PostRepl>[35]</PostRepl>
        </EachPostLi>
    )
}
